4. Do **NOT** open WhatsApp. Now restore WhatsApp backup we created on step 1. Make sure you “Restore Data”  and DO NOT RESTORE APP
5. Start app, and see logcat.
6. Search in log for: WhatsApp pw (hex bytes)

**Remember:** Password is in hex bytes, you will need to base64 encode it. You can use [this site](http://www.base64encode.org/).

